-- start -- -- -- -- -- -- -- -- -- 

CREATE TABLE call_logs(
   call_date   date
  ,call_id     INTEGER PRIMARY KEY NOT NULL
  ,time_start VARCHAR(8)
  ,time_end   VARCHAR(8)
  ,ph_no      VARCHAR(12)
);


-- end  -- -- -- -- -- -- -- -- -- 

CREATE TABLE facebook_post(
   user_id   VARCHAR(12)
  ,post_id   INTEGER  NOT NULL PRIMARY KEY 
  ,post_date DATE 
  ,content   VARCHAR(135)
);


-- end  -- -- -- -- -- -- -- -- -- 

CREATE TABLE hall(
   hall_book_id INTEGER  NOT NULL PRIMARY KEY 
  ,hall_name    VARCHAR(18)
  ,event_type   VARCHAR(8)
  ,book_date    DATE 
  ,description  VARCHAR(217)
);


-- end  -- -- -- -- -- -- -- -- -- 

CREATE TABLE interview(
   interview_id INTEGER  NOT NULL PRIMARY KEY 
  ,person_id    INTEGER 
  ,transcript   VARCHAR(264)
);

-- end  -- -- -- -- -- -- -- -- -- 

CREATE TABLE license(
   license_id VARCHAR(8) NOT NULL PRIMARY KEY
  ,age        INTEGER 
  ,height     INTEGER 
  ,gender     VARCHAR(1)
  ,car_model  VARCHAR(13)
  ,car_make   VARCHAR(14)
  ,ph_no      VARCHAR(12)
  ,nameplate  VARCHAR(11)
);


-- end  -- -- -- -- -- -- -- -- -- 

CREATE TABLE parking(
   parking_id INTEGER  NOT NULL PRIMARY KEY 
  ,license_id VARCHAR(6)
  ,time_in    VARCHAR(8)
  ,time_out   VARCHAR(8)
  ,remarks    VARCHAR(24)
);


-- end ------------------

CREATE TABLE person(
   person_id    INTEGER  NOT NULL PRIMARY KEY 
  ,name         VARCHAR(17)
  ,license_id   VARCHAR(8)
  ,address_no   INTEGER 
  ,address_name VARCHAR(26)
);





-- end --------------------------------

CREATE TABLE staff(
   staff_id            INTEGER  NOT NULL PRIMARY KEY 
  ,person_id           INTEGER 
  ,role                VARCHAR(16)
  ,designated_location VARCHAR(22)
);

